import React from 'react';

function Header(props){
    return(
        <div className="container-fluid d-flex dHeader">
            <div className="col-lg-4 col-md-4 col-sm-4">
                <h1>Memories</h1>
                <p className="hMemories">Memories, events and experiences</p>
            </div>
            <div className="container d-flex col-lg-4 col-md-8 col-sm-8">
            <p className="col-lg-6 text-center hUser">Hello User</p>
            <p className="col-lg-6 hName h2">Project Name</p>
            </div>
        </div> 
    )
}

export default Header
